import React from "react";
import { Bar } from "react-chartjs-2";

export default function Char() {
  const data = {
    labels: [1, 2, 3, 4, 5, 6, 7],
    datasets: [
      {
        labels: "this is first",
        data: [10, 20, 30, 40, 50],
      },
    ],
  };

  return (
    <>
      <Bar data={data} />
    </>
  );
}
